function roundToPrecision(n, precision, fixed) {
    n = parseFloat(n);

    if ( isNaN(n) || !isFinite(n) ) {
        return NaN;
    }

    if ( !precision || isNaN(precision) || !isFinite(precision) || precision < 1 ) {
        return Math.round( n );
    }

    var q = Math.pow(10, precision);
    n = Math.round( n * q ) / q;

    if (fixed) {
        n = n.toFixed(fixed);
    }

    return n;
}

/**
 * Obtains a human-readable file size string (1024 based).
 * @param {Number} bytes The file size in bytes
 * @param {Number} precision (optional) Defaults to 2
 * @return {String}
 */
function readableFileSize(bytes, { precision, fixed, useBinary } = {}) {
    let i = 0;
    const base = useBinary ? 1024 : 1000;
    const units = useBinary ?
        ["Bytes", "KiB", "MiB", "GiB", "TiB", "PiB", "EiB", "ZiB", "YiB"] :
        ["Bytes", "kB" , "MB" , "GB" ,  "TB", "PB" , "EB" , "ZB" , "YB" ];

    while (bytes > base && i < units.length - 1) {
        bytes = bytes / base;
        i++;
    }

    let out = Math.max(bytes, 0);

    if (precision || precision === 0) {
        out = roundToPrecision( out, precision );
    }

    if (fixed) {
        out = out.toFixed(fixed);
    }

    return out + " " + units[i];
}

/**
 * Returns the int representation of the first argument or the
 * "defaultValue" if the int conversion is not possible.
 * @memberof Utils
 * @param {*} x The argument to convert
 * @param {*} defaultValue The fall-back return value. This is going to be
 * converted to integer too.
 * @return {Number} The resulting integer.
 */
function intVal( x, defaultValue ) {
    var out = parseInt(x, 10);
    if ( isNaN(out) || !isFinite(out) ) {
        out = defaultValue === undefined ? 0 : intVal(defaultValue);
    }
    return out;
}

/**
 * Returns the float representation of the first argument or the
 * "defaultValue" if the int conversion is not possible.
 * @memberof Utils
 * @param {*} x The argument to convert
 * @param {*} defaultValue The fall-back return value. This is going to be
 * converted to float too.
 * @return {Number} The resulting integer.
 */
function floatVal( x, defaultValue ) {
    var out = parseFloat(x);
    if ( isNaN(out) || !isFinite(out) ) {
        out = defaultValue === undefined ? 0 : floatVal(defaultValue);
    }
    return out;
}

function uInt( x, defaultValue ) {
    return Math.max(intVal( x, defaultValue ), 0);
}

function uFloat( x, defaultValue ) {
    return Math.max(floatVal( x, defaultValue ), 0);
}

module.exports = {
    uFloat,
    uInt,
    intVal,
    floatVal,
    readableFileSize,
    roundToPrecision
};

const { Transform } = require("stream");
const FS            = require("fs");
const Path          = require("path");

/**
 * Transforms stream of bytes to stream of lines as strings
 */
class LineStream extends Transform
{
    constructor()
    {
        super({
            writableObjectMode: true,
            readableObjectMode: false,
            encoding: "utf8"
        });

        this._buffer = "";
    }


    _transform(chunk, _encoding, next)
    {
        try {
            this._buffer += chunk;
            const index = this._buffer.search(/\n/);
            if (index > 0) {
                const line = this._buffer.substr(0, index);
                this.push(line);
                this._buffer = this._buffer.substr(index + 1);
            }
            next();
        } catch (error) {
            next(error);
        }
    }
}

/**
 * Transforms stream of JSON strings to stream of JSON objects
 */
class NdJsonStream extends Transform
{
    constructor()
    {
        super({
            writableObjectMode: true,
            readableObjectMode: true
        });
    }


    _transform(chunk, _encoding, next)
    {
        try {
            const json = JSON.parse(chunk);
            this.push(json);
            next();
        } catch (error) {
            next(error);
        }
    }
}

exports.LineStream = LineStream;

/**
 * Given a file path reads it as stream and calls the callback for each line
 * @param {String} filePath Path to ndjson file
 * @param {Function} callback The callback function
 * @param {Function} onFinish Optional onFinish callback
 */
exports.forEachLine = function forEachLine(filePath, callback, onFinish)
{
    const lineStream = FS.createReadStream(filePath, {
        encoding: "utf8",
        highWaterMark: 10
    }).pipe(new LineStream()); // .pipe(new NdJsonStream());

    let index = 0;

    if (onFinish) {
        lineStream.once("finish", () => onFinish(index));
    }

    lineStream.on('data', data => {
        callback(data, index++)
    });
}



